import React, { useState, useEffect } from 'react';

const Card = ({ product }) => {
  return (
    <div className="card">
      <img src={product.thumbnail} alt={product.title} />
      <h2>{product.title}</h2>
      <p>Rating: {product.rating}</p>
      <p>Price: ${product.price}</p>
    </div>
  );
};

export default Card;
